import React from "react"
import Titels from "./Components/Title"
import Form from "./Components/Form"
import Weather from "./Components/Weather"

const API_key = "961cd45b0c76819135b50d3b6d1590c8";


class App extends React.Component{

    getWeather = async (e) => {
        e.preventDefault();
        const api_call = await fetch(`api.openweathermap.org/data/2.5/weather?q=${city},${country}`);

        var city = e.target.element.city.value;
        var country = e.target.element.country.value;


        const weather_data = await api_call.json();
        console.log(weather_data);
    }

    render(){
        return(
            <div>
                <Titels />
                <Form getWeather={this.getWeather}/>
                <Weather />
            </div>
        );
    }
}

export default App;
